import Link from 'next/link';
import { HeaderContainer } from '../Styles';

const Header = () => {
    return(
        <HeaderContainer>
            <h4>View Users</h4>
            <nav>
                <Link href='/'>
                    <Anchor>View Users</Anchor>
                </Link>
                <Link href='/add-user'>
                    <Anchor>Add User</Anchor>
                </Link>
            </nav>
        </HeaderContainer>
    );
}

export default Header;
